    /**
     * @function ol.supermap.StyleUtils.dashStyle
     * @description ç¬¦å·æ ·å¼ã
     * @param {Object} style - æ ·å¼åæ°ã
     * @param {number} widthFactor - å®½åº¦ç³»æ°ã
     */
    static dashStyle(style, widthFactor) {
        if (!style) {
            return [];
        }
        var w = style.strokeWidth * widthFactor;
        var str = style.strokeDashstyle || style.lineDash;
        switch (str) {
            case 'solid':
                return [0];
            case 'dot':
                return [1, 4 * w];
            case 'dash':
                return [4 * w, 4 * w];
            case 'dashdot':
                return [4 * w, 4 * w, 1, 4 * w];
            case 'longdash':
                return [8 * w, 4 * w];
            case 'longdashdot':
                return [8 * w, 4 * w, 1, 4 * w];
            default:
                if (!str) {
                    return [];
                }
                if (Util_Util.isArray(str)) {
                    return str;
                }
                str = BaseTypes_StringExt.trim(str).replace(/\s+/g, ",");
                return str.replace(/\[|\]/gi, "").split(",");
        }
    }

