    /**
     * @private
     * @function ol.supermap.WebMap.prototype.getGraphicsFromFeatures
     * @description å°featureè½¬æ¢æå¤§æ°æ®å¾å±å¯¹åºçGraphicsè¦ç´ 
     * @param {array} features - featureçéå
     * @param {object} style - å¾å±æ ·å¼
     * @param {string} featureType - featureçç±»å
     * @return {string}
     */
    getGraphicsFromFeatures(features, style, featureType) {
        let olStyle = StyleUtils_StyleUtils.getOpenlayersStyle(style, featureType),
            shape = olStyle.getImage();
        let graphics = [];
        //æå»ºgraphic
        for (let i in features) {
            let graphic = new external_ol_default.a.Graphic(features[i].getGeometry(), features[i].attributes);
            graphic.setStyle(shape);
            graphics.push(graphic);
        }
        return graphics;
    }

